import Form from "../components/Form";
import Grid from "@mui/material/Grid";
import TextField from '@mui/material/TextField';
import Table from "../components/Table";

export const Student = () => {
  return (
    <>
      <Form title="Estudiante">
        <Grid container spacing={1}>
          <Grid item xs={6}>
          <TextField id="outlined-basic" label="Nombre" variant="outlined" />
          </Grid>
          <Grid item xs={6}>
          <TextField id="outlined-basic" label="Apellido" variant="outlined" />
          </Grid>
          <Grid item xs={6}>
          <TextField id="outlined-basic" label="Email" variant="outlined" />
          </Grid>
          <Grid item xs={6}>
          <TextField id="outlined-basic" label="DNI" variant="outlined" />
          </Grid>
          <Grid item xs={6}>
          <TextField id="outlined-basic" label="Celular" variant="outlined" />
          </Grid>
          <Grid item xs={6}>
          <TextField id="outlined-basic" label="S" variant="outlined" />
          </Grid>
        </Grid>


      </Form>
      <Table/>
    </>
  );
};

export default Student;
